import React from 'react'
import './categorie.css'
import logo from './Assets/logos.jpg'; // Tell webpack this JS file uses this image


const CategrieAnnonce = props =>{

    return (
        <div  className="firstcat">
            <div className="main-carousel" data-flickity='{ "cellAlign": "left","wrapAround": true, "freeScroll": true }'>
            <div className="carousel-cell1"><img src={logo}/></div>
    <div className="carousel-cell1"><img src={logo1}/></div>
    <div className="carousel-cell1"><img src={logo2}/></div>
    <div className="carousel-cell1"><img src={offrestage}/></div>
    <div className="carousel-cell1"><img src={offreemploie}/></div>
    <div className="carousel-cell1"><img src={stage}/></div>
</div>
        </div>
    );
};

export default CategrieAnnonce;
